const config = {
    title: "Product Management",
    api: {
      fetch: "/api/product",
      create: "/api/product",
      update: (id) => `/api/product/${id}`,
      delete: (id) => `/api/product/${id}`,
    },
    fields: [
      { name: "name", label: "Name", type: "text" },
      { name: "price", label: "Price", type: "number" },
    ],
    permissions: {
      view: "view_product",
      add: "add_product",
      edit: "edit_product",
      delete: "delete_product",
    },
  };
  
  export default config;
